const walkTree = function(current, path, keeper) {
    if (current.left) {
        walkTree(current.left, path.concat(current.val), keeper);
    }
    if (current.right) {
        walkTree(current.right, path.concat(current.val), keeper);
    }
    if (!current.left && !current.right) {
        // current is a leaf node. So check if this path is pseudo-palindromic.
        if (isPseudoPalindromic(path.concat(current.val))) {
            keeper.pathCount++;
        }
    }
}

const isPseudoPalindromic = function(values) {
    // If the count of each instance of distinct values in the array is even, the array is pseudo-palindromic
    let valueCount = new Map();
    values.forEach(value => {
        if (!valueCount.has(value)) {
            valueCount.set(value, 1);
        } else {
            valueCount.set(value, valueCount.get(value) + 1);
        }
    });

    // Now that we've counted each value, iterate over the counts. If we find at least two characters with an odd count, short circuit.
    // One instance of a single value doesn't rule out pseudo-palindrome state, because that value can be the pivot / middle.
    let oddCountFound = false;
    for (const valueKey of valueCount.keys()) {
        if (valueCount.get(valueKey) % 2 !== 0) {
            if (oddCountFound) {
                // Two or more values with odd counts rules out pseudo-palindrome state.
                return false;
            }
            oddCountFound = true;
        }
    }

    // If we didn't short circuit, it's a pseudo-palindrome.
    return true;
}



const getTree = function(values) {
    let treeLevels = [[{val: values.shift(), left: null, right: null }]];
    while (values.length > 0) {
        // The last level of the tree needs it's children attached, peak rather than pop
        let parentNodes = treeLevels.slice(-1)[0];
        let childNodes = [];
        parentNodes.forEach(parent => {
            let leftValue = values.shift(), rightValue = values.shift();
            if (leftValue != null) {
                leftValue = { val: leftValue, left: null, right: null };
                childNodes.push(leftValue);
            }
            parent.left = leftValue;

            if (rightValue != null) {
                rightValue = { val: rightValue, left: null, right: null };
                childNodes.push(rightValue);
            }
            parent.right = rightValue;
        });
        treeLevels.push(childNodes);
    }
    return treeLevels[0][0];
}

